const std = @import("std");

test "sample input" {
    const sample_input = "2 3 0 3 10 11 12 1 1 0 1 99 2 1 1 2";

    var direct_allocator = std.heap.DirectAllocator.init();
    defer direct_allocator.deinit();

    var arena = std.heap.ArenaAllocator.init(&direct_allocator.allocator);
    defer arena.deinit();

    var allocator = &arena.allocator;
    read_input(sample_input, allocator);

    std.debug.assert(sumMetadataEntries() == 138);
    std.debug.assert(findNodeValue(0) == 66);
}

const Node = struct {
    children: []usize, // An pointer to an array of indices
    metadata: []usize, // contiguous in metadata, so a slice works
};

const max_nodes = 20000;
const max_metadata = 20000;
var nodes: [max_nodes]Node = undefined;
var nodes_end: usize = 0;

var metadata: [max_metadata]usize = undefined;
var metadata_end: usize = 0;

pub fn main() void {
    var direct_allocator = std.heap.DirectAllocator.init();
    defer direct_allocator.deinit();

    var arena = std.heap.ArenaAllocator.init(&direct_allocator.allocator);
    defer arena.deinit();

    var allocator = &arena.allocator;
    read_input(main_input, allocator);

    std.debug.warn("Part 1: {}\n", sumMetadataEntries());
    std.debug.warn("Part 2: {}\n", findNodeValue(0));
}

fn read_input(text: []const u8, allocator: *std.mem.Allocator) void {
    var it = std.mem.separate(text, " ");
    read_node(&it, allocator); // Read root node, transitively reading all others
}

fn sumMetadataEntries() usize {
    var i: usize = 0;
    var sum: usize = 0;
    while (i < metadata_end) : (i += 1) {
        sum += metadata[i];
    }
    return sum;
}

fn findNodeValue(idx: usize) usize {
    const node = nodes[idx];
    var sum: usize = 0;
    if (node.children.len > 0) {
        for (node.metadata) |c_idx| {
            if (c_idx == 0 or c_idx > node.children.len) continue;
            sum += findNodeValue(node.children[c_idx - 1]);
        }
    } else {
        for (node.metadata) |m| {
            sum += m;
        }
    }
    return sum;
}

fn read_node(it: *std.mem.SplitIterator, allocator: *std.mem.Allocator) void {
    const n_children = std.fmt.parseInt(usize, it.next().?, 10) catch unreachable;
    const n_metadata = std.fmt.parseInt(usize, it.next().?, 10) catch unreachable;

    const cur_idx: usize = nodes_end;
    var node: *Node = &nodes[nodes_end];
    nodes_end += 1;

    const children_ptr = allocator.alloc(usize, n_children) catch unreachable;
    var children_read: usize = 0;
    while (children_read < n_children) : (children_read += 1) {
        //std.debug.warn("nodes[{}]: children_ptr[{}] = {}\n", cur_idx, children_read, nodes_end);
        children_ptr[children_read] = nodes_end;
        read_node(it, allocator);
    }

    const metadata_start: usize = metadata_end;
    var metadata_read: usize = 0;
    while (metadata_read < n_metadata) : (metadata_read += 1) {
        var md = std.fmt.parseInt(usize, it.next().?, 10) catch unreachable;
        metadata[metadata_end] = md;
        metadata_end += 1;
    }

    node.* = Node {
        .children = children_ptr,
        .metadata = metadata[metadata_start..metadata_end],
    };
}

